<p class="parrafo">Visualización que muestra los años de inicio y término de la acreditación de las carreras de diseño según las distintas instituciones que las ofrecen.</p>
<p class="parrafo"><a href="http://www.datavizcatalogue.com/methods/gantt_chart.html">GANTT CHART <br> </a>
Generalmente utilizado como una herramienta organizacional, este esquema muestra una lista de actividades o tareas y su duración en el tiempo, mostrando cuando cada una inicia y cuando termina.

</p>
